import * as React from 'react';
import { IActionBarProps } from '../shared';

export class ActionBar extends React.Component<IActionBarProps> {
	render(): JSX.Element {
		const { showCheck } = this.props;
		return (
			<div>
				<button
					disabled={!showCheck}
				>
					Check
				</button>
				<button>
					Fold
				</button>
				<button>
					Raise
				</button>
			</div>
		);
	}
}
